pragma solidity >=0.6.0 <0.8.0;
pragma experimental ABIEncoderV2;

/*import "https://github.com/OpenZeppelin/openzeppelin-contracts/blob/v3.4.0/contracts/access/Ownable.sol";
import "https://github.com/OpenZeppelin/openzeppelin-contracts/blob/v3.4.0/contracts/utils/Pausable.sol";
import "https://github.com/OpenZeppelin/openzeppelin-contracts/blob/v3.4.0/contracts/token/ERC721/ERC721.sol";
import "https://github.com/OpenZeppelin/openzeppelin-contracts/blob/v3.4.0/contracts/token/ERC721/IERC721Receiver.sol";*/

import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/utils/Pausable.sol";
import "@openzeppelin/contracts/token/ERC721/ERC721.sol";
import "@openzeppelin/contracts/token/ERC721/IERC721Receiver.sol";

contract ERC721DutchAuctionV1 is Ownable, Pausable, IERC721Receiver {

    using SafeMath for uint256;
    using EnumerableSet for EnumerableSet.UintSet;
    
    ERC721 private _nonFungibleContract;
    
    event AuctionCreated(address indexed seller, uint256 indexed tokenId);
    event AuctionUpdated(address indexed seller, uint256 indexed tokenId);
    event AuctionCancelled(address indexed seller, uint256 indexed tokenId);
    event AuctionSuccessful(address indexed seller, address indexed winner, uint256 indexed tokenId, uint256 price);
    
    // Auction struct which holds all the required info
    struct Auction {
        address seller;
        uint256 tokenId;
        uint256 startedAt; // time
        uint128 startingPrice; // wei
        uint128 endingPrice; // wei
        uint64 duration; // seconds
        bool closeWhenTimeout;
    }
    // input data type to create Auction
    struct AuctionInput {
        uint256 tokenId;
        uint128 startingPrice; // wei
        uint128 endingPrice; // wei
        uint64 duration; // seconds
        bool closeWhenTimeout;
    }
    
    EnumerableSet.UintSet private _auctionTokenIds;
    mapping (uint256 => Auction) private _tokenIdToAuction;
    mapping (address => EnumerableSet.UintSet) private _ownerToAuctionTokenId;

    // User & Native Token
    event UserDeposit(address indexed from, uint256 value);
    event UserWithdraw(address indexed from, address indexed to, uint256 value);

    mapping(address => uint256) private _userBalances;
    uint256 private _totalUserBalance;

    // ----------------------------------------------------------------------------
    constructor(address nftAddress) {
        _nonFungibleContract = ERC721(nftAddress);
    }
    // Nhận Native token (VeChain không hỗ trợ)
    receive() external payable {
        _deposit(_msgSender(), msg.value);
    }

    // ----------------------------------------------------------------------------
    // Write Contract
    // ----------------------------------------------------------------------------
    /**
     * Users create|update auctions
     */
    function createAuctions(AuctionInput[] memory _inputs) external whenNotPaused returns (bool[] memory results) {
        results = new bool[](_inputs.length);
        for (uint i = 0; i < _inputs.length; i++) {
            //if (_inputs[i].startingPrice > 340282366920938463463374607431768211455) continue; // max value of uint128 = 340282366920938463463374607431768211455 (No need to check)
            if (_inputs[i].endingPrice <= 0) continue; // endingPrice must be greater than 0
            if (_inputs[i].startingPrice < _inputs[i].endingPrice) continue; // startingPrice must be bigger than or equal to endingPrice
            if (_inputs[i].duration < 1 minutes) continue; // duration must be greater than or equal to 1 minutes
            bool valid = false;
            uint256 tokenId = _inputs[i].tokenId;
            if (_tokenIdToAuction[tokenId].startedAt == 0) {
                // create
                _auctionTokenIds.add(tokenId);
                _ownerToAuctionTokenId[_msgSender()].add(tokenId);
                _nonFungibleContract.safeTransferFrom(_msgSender(), address(this), tokenId);
                emit AuctionCreated(_msgSender(), tokenId);
                valid = true;
            } else if (_msgSender() == _tokenIdToAuction[tokenId].seller) {
                // update
                emit AuctionUpdated(_msgSender(), tokenId);
                valid = true;
            }

            if (valid) {
                _tokenIdToAuction[tokenId] = Auction({
                    seller: _msgSender(),
                    tokenId: uint256(tokenId),
                    startedAt: uint256(block.timestamp),
                    startingPrice: uint128(_inputs[i].startingPrice),
                    endingPrice: uint128(_inputs[i].endingPrice),
                    duration: uint64(_inputs[i].duration),
                    closeWhenTimeout: bool(_inputs[i].closeWhenTimeout)
                });
                results[i] = true;
            }
        }
    }

    function createAuction(
        uint256 tokenId,
        uint128 startingPrice,
        uint128 endingPrice,
        uint64 duration,
        bool closeWhenTimeout
        ) external whenNotPaused returns (bool result) {
            // require(endingPrice > 0, "E8"); // endingPrice must be greater than 0
            // require(startingPrice >= endingPrice, "E9"); // startingPrice must be bigger than or equal to endingPrice
            // require(duration >= 1 minutes, "E10"); // duration must be greater than or equal to 1 minutes
            if (endingPrice <= 0 || startingPrice < endingPrice || duration < 1 minutes) {
                return false;
            }
            
            bool valid = false;
            if (_tokenIdToAuction[tokenId].startedAt == 0) {
                // create
                _auctionTokenIds.add(tokenId);
                _ownerToAuctionTokenId[_msgSender()].add(tokenId);
                _nonFungibleContract.safeTransferFrom(_msgSender(), address(this), tokenId);
                emit AuctionCreated(_msgSender(), tokenId);
                valid = true;
            } else if (_msgSender() == _tokenIdToAuction[tokenId].seller) {
                // update
                emit AuctionUpdated(_msgSender(), tokenId);
                valid = true;
            }

            if (valid) {
                _tokenIdToAuction[tokenId] = Auction({
                    seller: _msgSender(),
                    tokenId: uint256(tokenId),
                    startedAt: uint256(block.timestamp),
                    startingPrice: uint128(startingPrice),
                    endingPrice: uint128(endingPrice),
                    duration: uint64(duration),
                    closeWhenTimeout: bool(closeWhenTimeout)
                });
            }
            result = valid;
    }

    /**
     * Users bid auctions
     */
    function bid(uint256[] memory _tokenIds) external payable whenNotPaused returns (bool[] memory results) {
        _deposit(_msgSender(), msg.value);
        results = new bool[](_tokenIds.length);
        for (uint i = 0; i < _tokenIds.length; i++) {
            Auction memory auction = _tokenIdToAuction[_tokenIds[i]];
            if (auction.seller == _msgSender()) continue;
            if (_isOnAuction(auction) == false) continue;

            uint256 price = _auctionCurrentPrice(auction);
            if (price < auction.endingPrice || _userBalances[_msgSender()] < price) continue; // continue rather than break because there may be enough balance to buy the next item
            _subBalance(_msgSender(), price);
            _addBalance(auction.seller, price);
            _nonFungibleContract.safeTransferFrom(address(this), _msgSender(), _tokenIds[i]);
            _removeAuction(_tokenIds[i], auction.seller);
            emit AuctionSuccessful(auction.seller, _msgSender(), _tokenIds[i], price);
            results[i] = true;
        }
    }


    /**
     * Users cancel auctions
     */
    function cancelAuction(uint256[] memory _tokenIds) external whenNotPaused returns (bool[] memory results) {
        results = new bool[](_tokenIds.length);
        for (uint i = 0; i < _tokenIds.length; i++) {
            Auction memory auction = _tokenIdToAuction[_tokenIds[i]];
            if (auction.seller == _msgSender()) {
                _nonFungibleContract.safeTransferFrom(address(this), _msgSender(), _tokenIds[i]);
                _removeAuction(_tokenIds[i], auction.seller);
                emit AuctionCancelled(_msgSender(), _tokenIds[i]);
                results[i] = true;
            }
        }
    }

    /**
     * Users transfer native tokens to an address
     */
    function userWithdraw(address payable recipient, uint256 amount) external {
        require(recipient != address(0), "E2");// E2 = ERC721DutchAuctionV1: transfer to the zero address
        require(amount > 0, "E5");// E5 = ERC721DutchAuctionV1: transfer amount must be greater than 0
        require(_userBalances[_msgSender()] >= amount, "E6");// E6 = ERC721DutchAuctionV1: transfer amount exceeds balance
        _subBalance(_msgSender(), amount);
        
        (bool success,  ) = recipient.call{ value: amount }("");
        require(success, "E7");// E7 = ERC721DutchAuctionV1: unable to send value, recipient may have reverted
        emit UserWithdraw(_msgSender(), recipient, amount);
    }
    // ----------------------------------------------------------------------------
    // end Write Contract
    // ----------------------------------------------------------------------------


    // ----------------------------------------------------------------------------
    // internal|private Contract
    // ----------------------------------------------------------------------------
    function _addBalance(address account, uint256 amount) private {
        if (account != address(0) && account != address(this)) {
            _userBalances[account] = _userBalances[account].add(amount);
            _totalUserBalance = _totalUserBalance.add(amount);
        }
    }

    function _subBalance(address account, uint256 amount) private {
        _userBalances[account] = _userBalances[account].sub(amount);
        (, uint totalUserBalance_) = _totalUserBalance.trySub(amount); // if less than 0 then set to 0
        _totalUserBalance = totalUserBalance_;
    }

    function _deposit(address account, uint256 value) private {
        if (value > 0) {
            _addBalance(account, value);
            emit UserDeposit(account, value);
        }
    }

    function _removeAuction(uint256 tokenId, address seller) private {
        delete _tokenIdToAuction[tokenId];
        _auctionTokenIds.remove(tokenId);
        _ownerToAuctionTokenId[seller].remove(tokenId);
    }
    
    function _auctionCurrentPrice(Auction memory _auction) private view returns (uint256) {
        if (_auction.endingPrice == 0 || _auction.endingPrice == _auction.startingPrice) return _auction.endingPrice;
        uint64 secondsPassed = uint64(block.timestamp - _auction.startedAt);
        if (secondsPassed >= _auction.duration) {
            return _auction.endingPrice;
        } else {
            int256 totalPriceChange = int256(_auction.endingPrice) - int256(_auction.startingPrice);
            int256 currentPriceChange = totalPriceChange * int256(secondsPassed) / int256(_auction.duration);
            int256 currentPrice = int256(_auction.startingPrice) + currentPriceChange;
            return uint256(currentPrice);
        }
    }

    function _isOnAuction(Auction memory _auction) private view returns (bool) {
        uint64 secondsPassed = uint64(block.timestamp - _auction.startedAt);
        return (_auction.startedAt > 0 && (_auction.closeWhenTimeout == false || secondsPassed < _auction.duration));
    }
    // ----------------------------------------------------------------------------
    // end internal|private Contract
    // ----------------------------------------------------------------------------


    // ----------------------------------------------------------------------------
    // Read Contract
    // ----------------------------------------------------------------------------
    function NFTAddress() public view returns (ERC721) {
        return _nonFungibleContract;
    }

    function userBalanceOf(address account) public view returns (uint256) {
        return _userBalances[account]; // return native token of account
    }
    
    function auctionTotalSupply() public view returns (uint256) {
        return _auctionTokenIds.length();
    }
    
    function auctionsByIndex(uint256[] memory _indexs) public view returns (Auction[] memory auctions) {
        auctions = new Auction[](_indexs.length);
        for (uint i = 0; i < _indexs.length; i++) {
            uint256 tokenId = _auctionTokenIds.at(_indexs[i]);
            auctions[i] = _tokenIdToAuction[tokenId];
        }
    }
    
    function auctionsByTokenId(uint256[] memory _tokenIds) public view returns (Auction[] memory auctions) {
        auctions = new Auction[](_tokenIds.length);
        for (uint i = 0; i < _tokenIds.length; i++) {
            auctions[i] = _tokenIdToAuction[_tokenIds[i]];
        }
    }

    function auctionBalanceOf(address owner) public view returns (uint256) {
         return _ownerToAuctionTokenId[owner].length();
    }
    
    function auctionsOfOwnerByIndex(address owner, uint256[] memory _indexs) public view returns (Auction[] memory auctions) {
        auctions = new Auction[](_indexs.length);
        for (uint i = 0; i < _indexs.length; i++) {
            uint256 tokenId = _ownerToAuctionTokenId[owner].at(_indexs[i]);
            auctions[i] = _tokenIdToAuction[tokenId];
        }
    }
    
    // VeChain
    function auctionByIndex(uint256 _index) public view returns (address, uint256, uint256, uint128, uint128, uint64, bool) {
        uint256 tokenId = _auctionTokenIds.at(_index);
        Auction memory auc = _tokenIdToAuction[tokenId];
        return (auc.seller, auc.tokenId, auc.startedAt, auc.startingPrice, auc.endingPrice, auc.duration, auc.closeWhenTimeout);
    }
    // VeChain
    function auctionByTokenId(uint256 _tokenId) public view returns (address, uint256, uint256, uint128, uint128, uint64, bool) {
        Auction memory auc = _tokenIdToAuction[_tokenId];
        return (auc.seller, auc.tokenId, auc.startedAt, auc.startingPrice, auc.endingPrice, auc.duration, auc.closeWhenTimeout);
    }
    // VeChain
    function auctionOfOwnerByIndex(address owner, uint256 _index) public view returns (address, uint256, uint256, uint128, uint128, uint64, bool) {
        uint256 tokenId = _ownerToAuctionTokenId[owner].at(_index);
        Auction memory auc = _tokenIdToAuction[tokenId];
        return (auc.seller, auc.tokenId, auc.startedAt, auc.startingPrice, auc.endingPrice, auc.duration, auc.closeWhenTimeout);
    }
    
    function auctionCurrentPrice(uint256[] memory _tokenIds) public view returns (uint256[] memory prices) {
        prices = new uint[](_tokenIds.length);
        for (uint i = 0; i < _tokenIds.length; i++) {
            prices[i] = _auctionCurrentPrice(_tokenIdToAuction[_tokenIds[i]]);
        }
    }
    
    function isOnAuction(uint256[] memory _tokenIds) public view returns (bool[] memory results) {
        results = new bool[](_tokenIds.length);
        for (uint i = 0; i < _tokenIds.length; i++) {
            if (_isOnAuction(_tokenIdToAuction[_tokenIds[i]])) results[i] = true;
        }
    }
    // ----------------------------------------------------------------------------
    // end Read Contract
    // ----------------------------------------------------------------------------


    // ----------------------------------------------------------------------------
    // onlyOwner Write Contract
    // ----------------------------------------------------------------------------
    function pause() public onlyOwner whenNotPaused {
        _pause();
    }

    function unpause() public onlyOwner whenPaused {
        _unpause();
    }

    /**
     * The owner can cancel auctions when contract is Paused
     */
    function ownerCancelAuction(uint256[] memory _tokenIds) external onlyOwner whenPaused returns (bool[] memory results) {
        results = new bool[](_tokenIds.length);
        for (uint i = 0; i < _tokenIds.length; i++) {
            Auction memory auction = _tokenIdToAuction[_tokenIds[i]];
            if (auction.seller != address(0)) {
                _nonFungibleContract.safeTransferFrom(address(this), auction.seller, _tokenIds[i]);
                _removeAuction(_tokenIds[i], auction.seller);
                emit AuctionCancelled(auction.seller, _tokenIds[i]);
                results[i] = true;
            }
        }
    }

    /**
     * The owner can cancel invalid auctions (in case NFT tokenId has been burned)
     */
    function ownerCancelInvalidAuction(uint256[] memory _tokenIds) external onlyOwner returns (bool[] memory results) {
        results = new bool[](_tokenIds.length);
        for (uint i = 0; i < _tokenIds.length; i++) {
            Auction memory auction = _tokenIdToAuction[_tokenIds[i]];
            if (auction.seller != address(0)) {
                try _nonFungibleContract.ownerOf(_tokenIds[i]) /*returns (address owner)*/ {
                    // tokenId exists
                } catch  /*Error(string memory reason)*/ {
                    // ERC721: owner query for nonexistent token
                    _removeAuction(_tokenIds[i], auction.seller);
                    emit AuctionCancelled(auction.seller, _tokenIds[i]);
                    results[i] = true;
                }
            }
        }
    }

    /**
     * The owner can set nftAddress only when auctionTotalSupply is 0
     */
    function setNFTAddress(address nftAddress) external onlyOwner whenPaused {
        require(auctionTotalSupply() == 0, "E1");// E1 = ERC721DutchAuctionV1: there are still some auctions
        _nonFungibleContract = ERC721(nftAddress);
    }

    /**
     * The owner can transfer the native token if it is sent to the contract address but not from the user
     * This is rarely the case, unless the user withdraws and the receiving address is this contract address
     */
    function ownerWithdraw(address payable recipient) external onlyOwner {
        require(recipient != address(0), "E2");// E2 = ERC721DutchAuctionV1: transfer to the zero address
        require(recipient != address(this), "E3");// E3 = ERC721DutchAuctionV1: transfer to this contract address
        uint256 excess = address(this).balance.sub(_totalUserBalance);
        require(excess > 0, "E4");// E4 = ERC721DutchAuctionV1: no excess balance
        recipient.transfer(excess);
    }

    /**
     * The owner can transfer the NFTs if it is sent to the contract address without going through [createAuction] function
     */
    function ownerWithdrawNFT(address payable recipient, uint256[] memory _tokenIds) external onlyOwner {
        //require(recipient != address(0), "E2"); // no need to check because ERC721 checked
        require(recipient != address(this), "E3");
        require(auctionTotalSupply() == 0, "E1");
        for (uint i = 0; i < _tokenIds.length; i++) {
            _nonFungibleContract.safeTransferFrom(address(this), recipient, _tokenIds[i]);
        }
    }
    // ----------------------------------------------------------------------------
    // end onlyOwner Write Contract
    // ----------------------------------------------------------------------------


    // ----------------------------------------------------------------------------
    // onlyOwner Read Contract
    // ----------------------------------------------------------------------------
    function checkBalances() onlyOwner public view returns (uint256 balance, uint256 userBalance, int256 excess) {
        balance = address(this).balance;
        return (balance, _totalUserBalance, int(balance-_totalUserBalance));
    }
    // ----------------------------------------------------------------------------
    // end onlyOwner Read Contract
    // ----------------------------------------------------------------------------
    
    /**
     * support for _safeMint, _safeTransfer
     * Always returns `IERC721Receiver.onERC721Received.selector`.
     */
    function onERC721Received(address, address, uint256, bytes memory) public virtual override returns (bytes4) {
        return this.onERC721Received.selector;
    }
}
